import React from 'react';
import { motion } from 'framer-motion';
import './Process.css';

const Process = () => {


  return (
    <div className="process">

      <div className="p-left">

       <div className="brief">
        <div className="num">
          <h1>1</h1>
        </div>
        <div className="name">
         <h1>Briefing</h1>
        </div>
        <div className="describe">
         <p>Send me a detailed brief of the problem statement.</p>
        </div>
       </div>

       <div className="wireframe">
       <div className="num">
          <h1>3</h1>
        </div>
        <div className="name">
         <h1>Wireframing</h1>
        </div>
        <div className="describe">
         <p>Designing the logical structure of the future UI based on research and structure from the customer.</p>
        </div>
       </div>

       <div className="high">
       <div className="num">
          <h1>5</h1>
        </div>
        <div className="name">
         <h1>High-Fidelity Prototyping</h1>
        </div>
        <div className="describe">
         <p>Design the high-fidelity prototype which will be similar to your final developed product.</p>
        </div>
       </div>

      </div>

      <div className="p-right">

      <div className="research">
      <div className="num">
          <h1>2</h1>
        </div>
        <div className="name">
         <h1>Research</h1>
        </div>
        <div className="describe">
         <p>Development Begins with competitive and visual analysis, target audience and market research.</p>
        </div>
      </div>

      <div className="testing">
      <div className="num">
          <h1>4</h1>
      </div>
      <div className="name">
         <h1>Testing</h1>
      </div>
      <div className="describe">
         <p>Starting with research plan , I will conduct usability study, and then find out themes and insights.</p>
      </div>
      </div>

      <div className="support">
      <div className="num">
          <h1>6</h1>
      </div>
      <div className="name">
         <h1>Transferring Files & Support</h1>
      </div>
      <div className="describe">
         <p>Prepare a design file with a fully developed project, including adaptive versions and all the necessary material to give to your developer.</p>
      </div>
      </div>


      </div>
    </div>
  );
};

export default Process;


